    false,nt"url": null,nt"notes": "This data set consists of digital water-table
    contours for the Mojave River, the Morongo and the Fort Irwin Ground-Water Basins.
    The U.S. Geological Survey constructed a water-table map of the Mojave River, the
    Morongo and the Fort Irwin Ground-Water Basins for ground-water levels measured
    during the period January-September 1996. Water-level data were collected from 632
    wells to construct the contours. The water-table contours were digitized from the
    paper map which was published at a scale of 1:175,512. The contour interval ranges
    from 3,400 to 1,550 feet above sea level.",nt"owner_org": "bd2cdd5a-4d65-46c0-9937-c8381175f104",nt"extras":
